import axios from "axios";
export default class WTSOImage {
    constructor(){

    }
    getSrc = () => {
        let promise = new Promise((resolve, reject) => {
            axios
            .get('https://www.wtso.com/')
            .then((response) => {
                resolve(response);

            })
            .catch((err) => {
                reject(err);
            });
        });
        return promise;
    }
}
